import React from "react";
import "./App.css";

import Dashboard from "../views/DashBoard";
import Student from "../views/Student";
import Nav from "../views/Nav";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

//state, router en functions
const Home = () => (
  <div>
    <h1>Home</h1>

          <p>Dit is de eindopdracht van de Winc Academy Front-end opleiding</p>
          <p>Klik op Student Dashboard om een mooi overzicht te zien van wat de studenten</p>
          <p>van alle Front-end opdrachten vonden</p>
  </div>
);

class App extends React.Component {

  render() {
    return (

      <Router>
        <div className="App">
          <Nav />
          <Switch>
          <Route exact path="/"><Home /></Route>
          <Route path="/dashboard" component={Dashboard} />
          <Route path="/student" component={Student} />
          </Switch>
        </div>
      </Router>
    );
  }
}

export default App;
